import React from 'react';
import { Link } from 'react-router-dom'; 
import './Register.css'
import logo from '../../images/logo_top.png'

function Register(){
    return (
            <section className="register">
                <div className="register_top">
                    <div className="register_top-container">
                    <img src={logo} className="register_logo"/>
                <p className="register_header-title">Добро пожаловать!</p>
                </div>
                    </div>
                
            </section>
                
            
      );
}

export default Register;
